Wydarzenia\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:8:\"wordcamp\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"https://pl.wordpress.org/?p=45206\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:402:\"W dniach 26–28 września 2025 spotkamy się ponownie w Gdyni, by wziąć udział w jednym z najważniejszych wydarzeń dla polskiej (i nie tylko!) społeczności WordPressa. Tegoroczna edycja będzie wyjątkowa pod wieloma względami i zapowiada się na największy WordCamp, jaki dotąd odbył się nad polskim morzem. Nowy kierunek: WordCamp z międzynarodowym rozmachem Po raz pierwszy w [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Mariusz Szatkowski\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2633:\"\n<p>W dniach 26–28 września 2025 spotkamy się ponownie w Gdyni, by wziąć udział w jednym z najważniejszych wydarzeń dla polskiej (i nie tylko!) społeczności WordPressa. Tegoroczna edycja będzie wyjątkowa pod wieloma względami i zapowiada się na największy WordCamp, jaki dotąd odbył się nad polskim morzem.</p>\n\n\n\n<p><strong>Nowy kierunek: WordCamp z międzynarodowym rozmachem</strong></p>\n\n\n\n<p>Po raz pierwszy w historii polskich WordCampów zaplanowaliśmy dedykowaną ścieżkę prelekcji w języku angielskim. To krok w stronę budowania jeszcze szerszej, bardziej różnorodnej społeczności. Ścieżka anglojęzyczna będzie towarzyszyła nam w piątek i niedzielę, dając szansę prelegentom i uczestnikom z całej Europy na aktywne uczestnictwo.</p>\n\n\n\n<p>Do Gdyni zapraszamy nie tylko uczestników z Polski, ale również gości z Niemiec, Skandynawii (Norwegia, Dania, Szwecja, Finlandia) oraz krajów nadbałtyckich (Litwa, Łotwa, Estonia). Dzięki licznym i tanim połączeniom lotniczym z Gdańska, Gdynia staje się dostępnym i atrakcyjnym miejscem dla europejskich WordPressowiczów.</p>\n\n\n\n<p>Wydarzenie odbywa się w przestrzeniach nowoczesnego Pomorskiego Parku Naukowo-Technologicznego (PPNT) i przewidujemy obecność <strong>300–400 uczestników</strong>. Oprócz ścieżki międzynarodowej znajdą się także prelekcje techniczne (WordPress development, backend, frontend), sesje SEO, UX, marketingowe, warsztaty oraz <strong>Contributor Day</strong>.</p>\n\n\n\n<p><strong>Jeszcze tylko 25 biletów Early Birds!</strong></p>\n\n\n\n<p>Aktualnie w sprzedaży pozostało tylko <strong>25 biletów Early Birds</strong>. To najniższa możliwa cena udziału w wydarzeniu (100 zł) i nie planujemy kolejnej obniżki. Bilety można kupić pod adresem: <a href=\"https://gdynia.wordcamp.org/2025/bilety/\">https://gdynia.wordcamp.org/2025/bilety/</a></p>\n\n\n\n<p>Jeśli chcesz zdobyć wejściówkę w najlepszej cenie, warto się pospieszyć – sprzedaż regularna rozpocznie się niebawem, a ceny wzrosną.</p>\n\n\n\n<p><strong>Dlaczego warto być z nami?</strong></p>\n\n\n\n<ul class=\"wp-block-list\">\n<li>Poznasz społeczność WordPressa z całej Europy.</li>\n\n\n\n<li>Zdobędziesz konkretną, techniczną wiedzy.</li>\n\n\n\n<li>Weźmiesz udział w warsztatach i Contributor Day.</li>\n\n\n\n<li>Zintegrujesz się podczas kultowego Middle Party.</li>\n\n\n\n<li>Spędzisz trzy dni w inspirującej atmosferze tuż nad Bałtykiem.</li>\n</ul>\n\n\n\n<p>Więcej informacji znajdziesz na stronie wydarzenia: <a href=\"https://gdynia.wordcamp.org/2025\">https://gdynia.wordcamp.org/2025</a></p>\n\n\n\n<p>Do zobaczenia w Gdyni!</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"https://pl.wordpress.org/2025/05/10/wordcamp-gdynia-2025-zbliza-sie-wielkimi-krokami/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"45206\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:76:\"\n		\n		\n					\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"Odliczanie dobiegło końca – WordUp Gdynia już w tym tygodniu!\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:95:\"https://pl.wordpress.org/2025/04/03/odliczanie-dobieglo-konca-wordup-gdynia-juz-w-tym-tygodniu/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:103:\"https://pl.wordpress.org/2025/04/03/odliczanie-dobieglo-konca-wordup-gdynia-juz-w-tym-tygodniu/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 03 Apr 2025 04:21:29 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:10:\"Wydarzenia\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:6:\"WordUp\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"https://pl.wordpress.org/?p=43781\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:341:\"5 kwietnia widzimy się w Muzeum Miasta Gdyni, żeby razem z Wami zanurzyć się w świat WordPressa – bez napinki, za to z konkretną dawką wiedzy i solidnym afterem. A kto stanie na scenie? 🎤 Maciek Palmowski – o największym bug bounty w historii WordPressa🎤 Paweł Gontarek – brutalnie szczerze o tym, kiedy SEO ma [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Marcin Pietrzak\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2230:\"\n<p>5 kwietnia widzimy się w Muzeum Miasta Gdyni, żeby razem z Wami zanurzyć się w świat WordPressa – bez napinki, za to z konkretną dawką wiedzy i solidnym afterem.</p>\n\n\n\n<h2 class=\"wp-block-heading\">A kto stanie na scenie?</h2>\n\n\n\n<p><img src=\"https://s.w.org/images/core/emoji/16.0.1/72x72/1f3a4.png\" alt=\"🎤\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Maciek Palmowski – o największym bug bounty w historii WordPressa<br><img src=\"https://s.w.org/images/core/emoji/16.0.1/72x72/1f3a4.png\" alt=\"🎤\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Paweł Gontarek – brutalnie szczerze o tym, kiedy SEO ma sens<br><img src=\"https://s.w.org/images/core/emoji/16.0.1/72x72/1f3a4.png\" alt=\"🎤\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Aleksandra Grygiel – jak uniknąć najczęstszych wpadek hostingowych<br><img src=\"https://s.w.org/images/core/emoji/16.0.1/72x72/1f3a4.png\" alt=\"🎤\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Piotr Mońka – błędy w dostępności, które utrudniają życie użytkownikom<br><img src=\"https://s.w.org/images/core/emoji/16.0.1/72x72/1f3a4.png\" alt=\"🎤\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Karolina Czapla – jak zbadać rynek, zanim zaczniesz pisać wtyczkę<br><img src=\"https://s.w.org/images/core/emoji/16.0.1/72x72/1f3a4.png\" alt=\"🎤\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Tomasz Skupny – OSINT, RODO, umowy i inne rzeczy, które uchronią Cię przed znikającym klientem<br><img src=\"https://s.w.org/images/core/emoji/16.0.1/72x72/1f3a4.png\" alt=\"🎤\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Max Matłoka – czego nauczył się, będąc zhackowanym (spoiler: dużo)<br><img src=\"https://s.w.org/images/core/emoji/16.0.1/72x72/1f3a4.png\" alt=\"🎤\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Rafał Chrzan – REST API, luka w zabezpieczeniach i jak nie stracić swoich cyfrowych produktów</p>\n\n\n\n<p>Wiedza, społeczność, inspiracje i luźna atmosfera – to wszystko już w ten piątek!Nie masz jeszcze wejściówki?</p>\n\n\n\n<p><a href=\"https://wp.trojmiasto.us/#rejestracja\">wp.trojmiasto.us/#rejestracja</a></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:100:\"https://pl.wordpress.org/2025/04/03/odliczanie-dobieglo-konca-wordup-gdynia-juz-w-tym-tygodniu/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_e