4:\"data\";s:407:\"Po dłuższej przerwie znów spotykamy się na żywo, by rozmawiać o WordPressie, wymieniać doświadczenia i integrować się w najlepszym towarzystwie! 1 kwietnia – i to wcale nie żart! H.4.O.S – przestrzeń, gdzie chaos to sztuka! Spotykamy się w niezwykłym miejscu, które idealnie oddaje ducha WordUp&#8217;a. Gaming, bar i planszówki? Brzmi jak przepis na niezapomnianą atmosferę! [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Marcin Pietrzak\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1265:\"\n<p>Po dłuższej przerwie znów spotykamy się na żywo, by rozmawiać o WordPressie, wymieniać doświadczenia i integrować się w najlepszym towarzystwie!</p>\n\n\n\n<p><img decoding=\"async\" height=\"16\" width=\"16\" alt=\"&#x1f4c5;\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t7e/1/16/1f4c5.png\"> 1 kwietnia – i to wcale nie żart!</p>\n\n\n\n<p><img decoding=\"async\" height=\"16\" width=\"16\" alt=\"&#x1f4cd;\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t2d/1/16/1f4cd.png\"> H.4.O.S – przestrzeń, gdzie chaos to sztuka!</p>\n\n\n\n<p>Spotykamy się w niezwykłym miejscu, które idealnie oddaje ducha WordUp&#8217;a. Gaming, bar i planszówki? Brzmi jak przepis na niezapomnianą atmosferę! Tutaj strategia łączy się z kreatywnością, a networking nabiera nowego wymiaru.</p>\n\n\n\n<p>Rezerwujcie czas, szykujcie pytania i wpadajcie na WordUp!</p>\n\n\n\n<h2 class=\"wp-block-heading\">Wejściówki</h2>\n\n\n\n<p>Udział jest bezpłatny, ale obowiązuje rezerwacja miejsc &#8211; musimy wiedzieć ile poczęstunku mamy szykować <img decoding=\"async\" height=\"16\" width=\"16\" alt=\"&#x1f37b;\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t96/1/16/1f37b.png\">.</p>\n\n\n\n<p><a href=\"https://app.evenea.pl/event/902653-1\">Zapisz się na WordUp Warszawa!</a></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"https://pl.wordpress.org/2025/03/19/wordup-warszawa-powraca/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"43702\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:76:\"\n		\n		\n					\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"Po zimowym rejsie – #22 WordUP Meetup Gdynia przybija do portu!\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:96:\"https://pl.wordpress.org/2025/03/18/po-zimowym-rejsie-22-wordup-meetup-gdynia-przybija-do-portu/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:104:\"https://pl.wordpress.org/2025/03/18/po-zimowym-rejsie-22-wordup-meetup-gdynia-przybija-do-portu/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 18 Mar 2025 16:45:17 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:10:\"Wydarzenia\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:6:\"WordUp\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"https://pl.wordpress.org/?p=43696\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:508:\"Już 5 kwietnia&#160;zapraszamy Cię do&#160;Muzeum Miasta Gdyni, by – dosłownie! – pogadać o WordPressie tuż nad morzem. Gdyńska społeczność wraca na scenę z nową energią i solidną dawką wiedzy od aż&#160;11 prelegentów: Czeka na Ciebie ponad&#160;11 inspirujących prezentacji&#160;oraz&#160;after party, gdzie będzie można wymienić się doświadczeniami i poznać fantastycznych ludzi z branży.https://www.facebook.com/events/3500311143606717 Pogoda zamówiona, beczki już [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Marcin Pietrzak\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:2442:\"\n<p><strong>Już 5 kwietnia</strong>&nbsp;zapraszamy Cię do&nbsp;<strong>Muzeum Miasta Gdyni</strong>, by – dosłownie! – pogadać o WordPressie tuż nad morzem. Gdyńska społeczność wraca na scenę z nową energią i solidną dawką wiedzy od aż&nbsp;<strong>11 prelegentów</strong>:</p>\n\n\n\n<ol class=\"wp-block-list\">\n<li><strong>Maciej Palmowski</strong>&nbsp;–&nbsp;<em>Historia największego bug bounty w WordPressie</em></li>\n\n\n\n<li><strong>Paweł Gontarek</strong>&nbsp;–&nbsp;<em>Na SEO mi to SEO?</em>&nbsp;(Czy pozycjonowanie zawsze się opłaca?)</li>\n\n\n\n<li><strong>Aleksandra Grygiel</strong>&nbsp;–&nbsp;<em>Hosting bez tajemnic – jak uniknąć najczęstszych problemów z WordPressem?</em></li>\n\n\n\n<li><strong>Piotr Mońka</strong>&nbsp;–&nbsp;<em>Accessibility: Błędy, które utrudniają życie</em></li>\n\n\n\n<li><strong>Karolina Czapla</strong>&nbsp;–&nbsp;<em>Czy moja wtyczka ma sens? 5 metod na samodzielne badanie rynku, zanim zaczniesz kodować</em></li>\n\n\n\n<li><strong>Tomasz Dziudek „Dziuda”</strong>&nbsp;–&nbsp;<em>Jak nie stracić potencjalnych klientów? Błędy, które mogą Cię sporo kosztować</em></li>\n\n\n\n<li><strong>Tomasz Skupny</strong>&nbsp;–&nbsp;<em>Nie pytaj co może zrobić dla Ciebie prawnik, tylko co możesz bez niego</em></li>\n\n\n\n<li><strong>Max Matłoka</strong>&nbsp;–&nbsp;<em>Ile razy trzeba zostać zhackowanym, aby czegoś się nauczyć?</em></li>\n\n\n\n<li><strong>Rafał Chrzan</strong>&nbsp;–&nbsp;<em>WordPress, REST API i bezpieczeństwo – co każdy sprzedawca produktów cyfrowych powinien wiedzieć</em></li>\n\n\n\n<li><strong>Filip Sroka</strong>&nbsp;– (niespodzianka, ale na pewno będzie się działo!)</li>\n\n\n\n<li><strong>Magdalena Paciorek</strong>&nbsp;– (kolejna niespodzianka – przyjdź i daj się zaskoczyć!)</li>\n</ol>\n\n\n\n<p>Czeka na Ciebie ponad&nbsp;<strong>11 inspirujących prezentacji</strong>&nbsp;oraz&nbsp;<strong>after party</strong>, gdzie będzie można wymienić się doświadczeniami i poznać fantastycznych ludzi z branży.<br><a href=\"https://www.facebook.com/events/3500311143606717\">https://www.facebook.com/events/3500311143606717</a></p>\n\n\n\n<p><strong>Pogoda zamówiona</strong>, beczki już się chłodzą – <strong>nie zwlekaj</strong> i zarezerwuj swoją darmową wejściówkę: <a href=\"https://wp.trojmiasto.us/#rejestracja\">https://wp.trojmiasto.us/#rejestracja</a></p>\n\n\n\n<p>Do zobaczenia w Gdyni!</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:101:\"https://pl.wordpress.org/2025/03/18/po-zimowym-rejsie-22-wordup-meetup-gdynia-przybija-do-portu/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"43696\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:82:\"\n		\n		\n					\n		\n		\n		\n				\n		\n		\n		\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"WCKRK – Aktualności #5 – kilka słów o agendzie\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"https://pl.wordpress.org/2025/03/05/wckrk-aktualnosci-5-kilka-slow-o-agendzie/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"https://pl.wordpress.org/2025/03/05/wckrk-aktualnosci-5-kilka-slow-o-agendzie/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 05 Mar 2025 09:54:55 +0000\";s:7:\"attribs\";a:0:{}s:8:\"x