\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"https://pl.wordpress.org/?p=36869\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:448:\"Zapraszamy na WordCamp Wrocław 2024, który odbędzie się w dniach 22-24 listopada 2024 roku we Wrocławiu!  To wyjątkowe wydarzenie skupiające społeczność WordPressa – zarówno tych, którzy dopiero zaczynają swoją przygodę, jak i zaawansowanych specjalistów. W tym roku WordCamp Wrocław oferuje trzy ścieżki (jedną dla początkujących), więc każdy znajdzie coś dla siebie!  Chcesz mieć realny wpływ na rozwój [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"Katka\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1581:\"\n<p><strong>Zapraszamy na <a href=\"https://wroclaw.wordcamp.org/2024/\">WordCamp Wrocław 2024</a>, który odbędzie się w dniach 22-24 listopada 2024 roku we Wrocławiu! </strong></p>\n\n\n\n<p>To wyjątkowe wydarzenie skupiające społeczność WordPressa – zarówno tych, którzy dopiero zaczynają swoją przygodę, jak i zaawansowanych specjalistów. W tym roku WordCamp Wrocław oferuje <strong>trzy ścieżki (jedną dla początkujących)</strong>, więc każdy znajdzie coś dla siebie! </p>\n\n\n\n<p>Chcesz mieć realny wpływ na rozwój WordPressa?&nbsp;<strong>Contributor Day (22.11.2024)</strong>&nbsp;to idealna szansa, aby dowiedzieć się, jak możesz wspierać ten projekt od środka. To dzień wypełniony praktycznymi działaniami, podczas którego nie tylko zdobędziesz cenne umiejętności, ale także od razu zaangażujesz się w rozwój platformy!</p>\n\n\n\n<p>WordCamp to znacznie więcej niż wykłady i warsztaty. To także doskonała okazja do nawiązania kontaktów z innymi miłośnikami WordPressa. Wieczorne imprezy integracyjne będą świetnym momentem, by pogłębić nowe znajomości i wymienić się doświadczeniami w swobodnej, przyjaznej atmosferze.&nbsp;</p>\n\n\n\n<p>Nie przegap tej szansy! Zarezerwuj swoje miejsce już teraz:<br><strong>Bilety</strong> -&gt; <a href=\"https://wroclaw.wordcamp.org/2024/bilety/\">https://wroclaw.wordcamp.org/2024/bilety/</a> (dla studentów niższa cena)</p>\n\n\n\n<p>Czekamy na Ciebie we Wrocławiu na&nbsp;<strong>WordCamp 2024</strong>! Dołącz do nas i bądź częścią tej wyjątkowej społeczności!</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"https://pl.wordpress.org/2024/10/11/wordcamp-wroclaw-polska-2024/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"36869\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"WordCamp Gdynia, Polska 2024\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"https://pl.wordpress.org/2024/05/14/wordcamp-gdynia-2024/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"https://pl.wordpress.org/2024/05/14/wordcamp-gdynia-2024/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 14 May 2024 21:15:13 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Wydarzenia\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"https://pl.wordpress.org/?p=33703\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:431:\"Zapraszamy na WordCamp Gdynia 2024, który odbędzie się w dniach 4-6 października 2024 roku w Gdyni (PL)! To wyjątkowa konferencja, która skupia społeczność WordPressa. Jest to wydarzenie dla każdego, od początkujących użytkowników, po zaawansowanych deweloperów. W tym roku będziemy zgłębiać tematy związane z najnowszymi trendami i technologiami w świecie WordPressa, w tym optymalizacją pracy oraz [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Mariusz Szatkowski\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1596:\"\n<p><strong>Zapraszamy na <a href=\"https://gdynia.wordcamp.org/2024/\" data-type=\"link\" data-id=\"https://gdynia.wordcamp.org/2024/\">WordCamp Gdynia 2024</a>, który odbędzie się w dniach 4-6 października 2024 roku w Gdyni (PL)!</strong></p>\n\n\n\n<p>To wyjątkowa konferencja, która skupia społeczność WordPressa. Jest to wydarzenie dla każdego, od początkujących użytkowników, po zaawansowanych deweloperów. W tym roku będziemy zgłębiać tematy związane z najnowszymi trendami i technologiami w świecie WordPressa, w tym optymalizacją pracy oraz samej platformy.</p>\n\n\n\n<p>Na WordCamp Gdynia 2024 czeka na Was mnóstwo inspirujących prezentacji, warsztatów oraz sesji networkingowych. Spotkacie pasjonatów WordPressa, którzy podzielą się swoją wiedzą i doświadczeniem, a także poznacie nowe osoby, z którymi będziecie mogli wymienić się pomysłami i nawiązać cenne kontakty zawodowe.</p>\n\n\n\n<p>Podczas konferencji poruszymy szerokie spektrum tematów, od tworzenia stron internetowych, przez SEO i marketing, po projektowanie i zarządzanie treścią. To doskonała okazja, aby dowiedzieć się więcej o najnowszych trendach i narzędziach, które mogą pomóc w codziennej pracy z WordPressem.</p>\n\n\n\n<p>Nie przegapcie tej okazji! Już teraz dostępne są bilety early birds w cenie 50 zł. Zarezerwujcie swoje miejsce na stronie: <a href=\"https://gdynia.wordcamp.org/2024/\">https://gdynia.wordcamp.org/2024/</a></p>\n\n\n\n<p>Czekamy na Was w Gdyni na WordCamp 2024! Dołączcie do społeczności WordPressa i bądźcie częścią tego wyjątkowego wydarzenia.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"https://pl.wordpress.org/2024/05/14/wordcamp-gdynia-2024/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"33703\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:6:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:39:\"WordUp Trójmiasto #21 – 11 maja 2024\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"https://pl.wordpress.org/2024/03/03/wordup-trojmiasto-21-11-maja-2024/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"https://pl.wordpress.org/2024/03/03/wordup-trojmiasto-21-11-maja-2024/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 03 Mar 2024 18:04:27 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Wydarzenia\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"https://pl.wordpress.org/?p=22871\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:384:\"Cześć! Właśnie skończyła się 20. edycja WordUp Trójmiasto 🎉, a my już nie możemy się doczekać kolejnej, 21. edycji, która odbędzie się 11 maja 2024 o godz. 12:00 📅. Poprzednia edycja, która miała miejsce 2 marca 2024 w Muzeum Miasta Gdyni 🏛, zgromadziła 120 pasjonatów WordPressa, oferując 11 merytorycznych prezentacji i dużą dawkę wiedzy na [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Mariusz Szatkowski\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:8932:\"\n<p>Cześć!</p>\n\n\n\n<p>Właśnie skończyła się 20. edycja WordUp Trójmiasto <img src=\"https://s.w.org/images/core/emoji/16.0.1/72x72/1f389.png\" alt=\"🎉\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />, a my już nie możemy się doczekać kolejnej, 21. edycji, która odbędzie się 11 maja 2024 o godz. 12:00 <img src=\"https://s.w.org/images/core/emoji/16.0.1/72x72/1f4c5.png\" alt=\"📅\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />. </p>\n\n\n\n<p>Poprzednia edycja, która miała miejsce 2 marca 2024 w Muzeum Miasta Gdyni <img src=\"https://s.w.org/images/core/emoji/16.0.1/72x72/1f3db.png\" alt=\"🏛\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />, zgromadziła 120 pasjonatów WordPressa, oferując 11 merytorycznych prezentacji i dużą dawkę wiedzy na temat designu, SEO, marketingu i tworzenia treści <img src=\"https://s.w.org/images/core/emoji/16.0.1/72x72/1f913.png\" alt=\"🤓\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />. Była to niepowtarzalna okazja do spotkania z ludźmi z branży, wymiany doświadczeń i nawet znalezienia przyszłego współpracownika czy klienta <img src=\"https://s.w.org/images/core/emoji/16.0.1/72x72/1f465.png\" alt=\"👥\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />.</p>\n\n\n\n<p>Dlaczego warto już teraz zaplanować swoją obecność na <a href=\"https://wp.trojmiasto.us/#rejestracja\">WordUp Trójmiasto #21</a>? Jeśli poprzednia edycja jest jakimkolwiek wyznacznikiem, możemy się spodziewać jeszcze więcej inspirujących prezentacji <img src=\"https://s.w.org/images/core/emoji/16.0.1/72x72/1f3a4.png\" alt=\"🎤\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />, spotkań z ekspertami i możliwości do networkingu <img src=\"https://s.w.org/images/core/emoji/16.0.1/72x72/1f91d.png\" alt=\"🤝\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />. To szansa nie tylko na zdobycie nowej wiedzy, ale również na spotkanie z innymi entuzjastami WordPressa, co jest bezcenne w naszej branży.</p>\n\n\n\n<p>Edycja #21 to kolejna okazja do zanurzenia się w świat WordPressa i poszerzenia swoich horyzontów <img src=\"https://s.w.org/images/core/emoji/16.0.1/72x72/1f680.png\" alt=\"🚀\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />. Niezależnie od tego, czy jesteś deweloperem, projektantem, specjalistą SEO, czy pasjonatem tworzenia treści, znajdziesz coś dla siebie. Networking na steroidach, jak to było podczas poprzedniej edycji, zapewni możliwość nawiązania nowych kontaktów biznesowych i wymiany doświadczeń z innymi uczestnikami <img src=\"https://s.w.org/images/core/emoji/16.0.1/72x72/1f4bc.png\" alt=\"💼\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />.</p>\n\n\n\n<p>Zachęcamy do wcześniejszej rejestracji, aby lepiej zorganizować wydarzenie <img src=\"https://s.w.org/images/core/emoji/16.0.1/72x72/2705.png\" alt=\"✅\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />. Wszystkie szczegóły dotyczące rejestracji i więcej informacji na temat samego wydarzenia znajdziecie na naszej stronie na Facebooku oraz na oficjalnej stronie wydarzenia <img src=\"https://s.w.org/images/core/emoji/16.0.1/72x72/1f310.png\" alt=\"🌐\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" />.</p>\n\n\n\n<p>Nie przegap tej wyjątkowej okazji do spotkania z entuzjastami WordPressa, odkrywania nowych inspiracji i zgłębiania wiedzy! Do zobaczenia 11 maja! <img src=\"https://s.w.org/images/core/emoji/16.0.1/72x72/1f388.png\" alt=\"🎈\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p>Pozdrawiam serdecznie, <br>Mariusz Szatkowski Organizator WordUp Trójmiasto</p>\n\n\n\n<figure class=\"wp-block-gallery has-nested-images columns-default is-cropped wp-block-gallery-1 is-layout-flex wp-block-gallery-is-layout-flex\">\n<figure class=\"wp-block-image size-large\"><a href=\"https://pl.wordpress.org/files/2024/03/2024-03-02-12.04.40-scaled.jpg\"><img loading=\"lazy\" decoding=\"async\" width=\"1024\" height=\"768\" data-id=\"22876\" src=\"https://pl.wordpress.org/files/2024/03/2024-03-02-12.04.40-1024x768.jpg\" alt=\"\" class=\"wp-image-22876\" srcset=\"https://pl.wordpress.org/files/2024/03/2024-03-02-12.04.40-1024x768.jpg 1024w, https://pl.wordpress.org/files/2024/03/2024-03-02-12.04.40-300x225.jpg 300w, https://pl.wordpress.org/files/2024/03/2024-03-02-12.04.40-768x576.jpg 768w, https://pl.wordpress.org/files/2024/03/2024-03-02-12.04.40-1536x1152.jpg 1536w, https://pl.wordpress.org/files/2024/03/2024-03-02-12.04.40-2048x1536.jpg 2048w, https://pl.wordpress.org/files/2024/03/2024-03-02-12.04.40-440x330.jpg 440w\" sizes=\"auto, (max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<figure class=\"wp-block-image size-large\"><a href=\"https://pl.wordpress.org/files/2024/03/2024-03-02-12.09.20-scaled.jpg\"><img loading=\"lazy\" decoding=\"async\" width=\"1024\" height=\"768\" data-id=\"22877\" src=\"https://pl.wordpress.org/files/2024/03/2024-03-02-12.09.20-1024x768.jpg\" alt=\"\" class=\"wp-image-22877\" srcset=\"https://pl.wordpress.org/files/2024/03/2024-03-02-12.09.20-1024x768.jpg 1024w, https://pl.wordpress.org/files/2024/03/2024-03-02-12.09.20-300x225.jpg 300w, https://pl.wordpress.org/files/2024/03/2024-03-02-12.09.20-768x576.jpg 768w, https://pl.wordpress.org/files/2024/03/2024-03-02-12.09.20-1536x1152.jpg 1536w, https:/